import React from 'react';

function Chart(props) {
	const chartData = [
		{ value: 0, month: 'Jan' },
		{ value: 0, month: 'Feb' },
		{ value: 0, month: 'Mar' },
		{ value: 0, month: 'Apr' },
		{ value: 0, month: 'May' },
		{ value: 0, month: 'Jun' },
		{ value: 0, month: 'Jul' },
		{ value: 0, month: 'Aug' },
		{ value: 0, month: 'Sep' },
		{ value: 0, month: 'Oct' },
		{ value: 0, month: 'Nov' },
		{ value: 0, month: 'Dec' },
	];
	props.filteredList.forEach((element) => {
		let month = element.date.toLocaleString('en-US', { month: 'numeric' });
		month--;
		chartData[month].value += element.cost;
		console.log(typeof chartData[month].value);
	});
	return <div></div>;
}

export default Chart;
